      <h1>Welcome to this react movies app</h1>
      <p>
        Lorem ipsum dolor, sit amet consectetur adipisicing elit. Quisquam
        maiores soluta consequatur aliquam, adipisci asperiores dignissimos
        consequuntur unde? Veritatis, aperiam.
      </p>
